text:
@Siisco_TTV For too long, the airline+auto industries &amp; the oil lobby have tried to block the viability of passenger rail.

We've tried it their way &amp; seen what airline oligopolies &amp; highway expansions have gotten us.

I plan on delivering for people no matter WHAT they have to say about it.

@tomfgoodwin Both go hand in hand.

HSR is best for long-distance, intercity transit where we can go 190, 200, 250 mph between stops far apart.

Well designed smart buses, light rail, and modern zoning reqs make the city around you more livable and navigable!

@Justin23488139 @WhiteHouse Absolutely absurd.

You don't have a right to possess an assault weapon in the same way you don't have a right to possess a tank.

I'm not for abolishing the Second Amendment, but if you aren't willing to accept basic background checks and storage reqs, you don't deserve a gun.

@david_iver52006 In a vacuum of government, the free market establishes government.

The result is the same, except with fewer people able to influence the outcome.

Despite its quirks, representative democracy is as good as we’ve found thus far, believe it or not…
